import React from "react";
import Logo from './logo.svg';

export default function Header() {
    return (
        <>
            <ul>
                <li className="d-flex logo">
                    <img src={Logo} alt="" srcset="" />
                    <h2 style={{
                        fontFamily: 'Montserrat',
                        fontStyle: 'normal',
                        fontWeight: '300',
                        fontSize: '30px',
                    }}>Gyber.org</h2>
                </li>
                <li>
                    <h1>Gyber.org</h1>
                </li>
                <li>
                    <button className="rgbBtn">Private sale</button>
                </li>
            </ul>
        </>
    );
}
